const e=JSON.parse('{"key":"v-eedfd1fc","path":"/views/Share/Law/Censorship/%E4%BA%92%E8%81%94%E7%BD%91%E5%B9%BF%E5%91%8A%E7%AE%A1%E7%90%86%E5%8A%9E%E6%B3%95.html","title":"互联网广告管理办法","lang":"zh-CN","frontmatter":{"title":"互联网广告管理办法","icon":"page","order":1,"author":"admin","date":"2023-05-06T00:00:00.000Z","description":"（2023年2月25日国家市场监督管理总局令第72号公布　自2023年5月1日起施行） 第一条　为了规范互联网广告活动，保护消费者的合法权益，促进互联网广告业健康发展，维护公平竞争的市场经济秩序，根据《中华人民共和国广告法》（以下简称广告法）《中华人民共和国电子商务法》（以下简称电子商务法）等法律、行政法规，制定本办法。 第二条　在中华人民共和国境内，利用网站、网页、互联网应用程序等互联网媒介，以文字、图片、音频、视频或者其他形式，直接或者间接地推销商品或者服务的商业广告活动，适用广告法和本办法的规定。","head":[["meta",{"property":"og:url","content":"https://mpbug.gitee.io/views/Share/Law/Censorship/%E4%BA%92%E8%81%94%E7%BD%91%E5%B9%BF%E5%91%8A%E7%AE%A1%E7%90%86%E5%8A%9E%E6%B3%95.html"}],["meta",{"property":"og:site_name","content":"魔法Bug"}],["meta",{"property":"og:title","content":"互联网广告管理办法"}],["meta",{"property":"og:description","content":"（2023年2月25日国家市场监督管理总局令第72号公布　自2023年5月1日起施行） 第一条　为了规范互联网广告活动，保护消费者的合法权益，促进互联网广告业健康发展，维护公平竞争的市场经济秩序，根据《中华人民共和国广告法》（以下简称广告法）《中华人民共和国电子商务法》（以下简称电子商务法）等法律、行政法规，制定本办法。 第二条　在中华人民共和国境内，利用网站、网页、互联网应用程序等互联网媒介，以文字、图片、音频、视频或者其他形式，直接或者间接地推销商品或者服务的商业广告活动，适用广告法和本办法的规定。"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"article:author","content":"admin"}],["meta",{"property":"article:published_time","content":"2023-05-06T00:00:00.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"互联网广告管理办法\\",\\"image\\":[\\"\\"],\\"datePublished\\":\\"2023-05-06T00:00:00.000Z\\",\\"dateModified\\":null,\\"author\\":[{\\"@type\\":\\"Person\\",\\"name\\":\\"admin\\"}]}"]]},"headers":[],"git":{},"readingTime":{"minutes":16.26,"words":4878},"filePathRelative":"views/Share/Law/Censorship/互联网广告管理办法.md","localizedDate":"2023年5月6日","excerpt":"<blockquote>\\n<p>（2023年2月25日国家市场监督管理总局令第72号公布　自2023年5月1日起施行）</p>\\n</blockquote>\\n<p>第一条　为了规范互联网广告活动，保护消费者的合法权益，促进互联网广告业健康发展，维护公平竞争的市场经济秩序，根据《中华人民共和国广告法》（以下简称广告法）《中华人民共和国电子商务法》（以下简称电子商务法）等法律、行政法规，制定本办法。</p>\\n<p>第二条　在中华人民共和国境内，利用网站、网页、互联网应用程序等互联网媒介，以文字、图片、音频、视频或者其他形式，直接或者间接地推销商品或者服务的商业广告活动，适用广告法和本办法的规定。</p>","autoDesc":true}');export{e as data};
